sys_variable_value.value:
(function execute(inputs, outputs) {

    var parsedJson = inputs.json_string;
    var delimiter_value = inputs.delimiter.toString().trim();
    var purchasingOrgArray = new sn_sap_data_int.IntegrationsUtils().parseExecuteRFC(parsedJson, delimiter_value);
    outputs.purchasing_organisation = purchasingOrgArray.JSONOBJECT;
    outputs.total_rows = purchasingOrgArray.ROWCOUNT;

})(inputs, outputs);

